import React, { useState } from "react";
import "../styles/Booking.css";

function Booking() {
    const [formData, setFormData] = useState({
        firstName: "",
        lastName: "",
        email: "",
        phone: "",
        serviceType: "Residential Snow Removal",
        propertySize: "< 500 sq ft",
        notes: "",
        date: "",
        timeSlot: "Morning",
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Form Data Submitted: ", formData);
        alert("Your appointment has been successfully booked!");
    };

    return (
        <div className="booking-page">
            <h2>Book Your Snow Removal Appointment</h2>
            <form className="booking-form" onSubmit={handleSubmit}>
                {/* Personal Information */}
                <div className="form-section">
                    <h3>Personal Information</h3>
                    <input
                        type="text"
                        name="firstName"
                        placeholder="First Name (Required)"
                        value={formData.firstName}
                        onChange={handleChange}
                        required
                    />
                    <input
                        type="text"
                        name="lastName"
                        placeholder="Last Name (Required)"
                        value={formData.lastName}
                        onChange={handleChange}
                        required
                    />
                    <input
                        type="email"
                        name="email"
                        placeholder="Email (Required)"
                        value={formData.email}
                        onChange={handleChange}
                        required
                    />
                    <input
                        type="tel"
                        name="phone"
                        placeholder="Phone Number (Required)"
                        value={formData.phone}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Service Details */}
                <div className="form-section">
                    <h3>Service Details</h3>
                    <select
                        name="serviceType"
                        value={formData.serviceType}
                        onChange={handleChange}
                        required
                    >
                        <option value="Residential Snow Removal">Residential Snow Removal</option>
                        <option value="Driveway Clearing">Driveway Clearing</option>
                        <option value="Sidewalk Clearing">Sidewalk Clearing</option>
                    </select>
                    <select
                        name="propertySize"
                        value={formData.propertySize}
                        onChange={handleChange}
                        required
                    >
                        <option value="< 500 sq ft">{"< 500 sq ft"}</option>
                        <option value="500 - 1500 sq ft">500 - 1500 sq ft</option>
                        <option value="> 1500 sq ft">{"> 1500 sq ft"}</option>
                    </select>
                    <textarea
                        name="notes"
                        placeholder="Additional Notes (Optional)"
                        value={formData.notes}
                        onChange={handleChange}
                    />
                </div>

                {/* Appointment Details */}
                <div className="form-section">
                    <h3>Appointment Details</h3>
                    <input
                        type="date"
                        name="date"
                        value={formData.date}
                        onChange={handleChange}
                        required
                    />
                    <select
                        name="timeSlot"
                        value={formData.timeSlot}
                        onChange={handleChange}
                        required
                    >
                        <option value="Morning">Morning</option>
                        <option value="Afternoon">Afternoon</option>
                        <option value="Evening">Evening</option>
                    </select>
                </div>

                {/* Submit Button */}
                <button type="submit" className="btn-submit">
                    Submit
                </button>
            </form>

            {/* Contact Information Section */}
            <div className="contact-info">
                <h3>Contact Information</h3>
                <p>Phone: 855-3X5-50X3</p>
                <p>Address: 506 Main St N, Red Deer, Alberta T6V 1P9</p>
                <p>Business Hours:</p>
                <p>Monday - Friday: 9:00 AM - 7:00 PM</p>
                <p>Saturday: 9:00 AM - 5:00 PM</p>
                <p>Sunday: Closed</p>
            </div>
        </div>
    );
}

export default Booking;
